import style from './Form.module.css'

import { useState } from 'react'

const Form = () =>{

    const [ userData, setUserData] = useState({
        username:'',
        password:'',
    })

    const handleOnChange = (event) =>{
        setUserData({
            ...userData,
            [event.target.name]: event.target.value
        })
    }

    return (
        <form action="">

            <label>Username:
                <input onChange={handleOnChange} type="text" name="userame" />
            </label>
            
            <label>
                Password: 
                <input onChange={handleOnChange} type="text" name="password" />
            </label>

            <button>LOGIN</button>

        </form>
    )
}

export default Form
